import React, { Component } from "react";

class Track extends React.Component {
  state = {};
  render() {
    return (
      <div className="track">
        <span>{this.props.id}</span>
        <span></span>
        <span></span>
        <span></span>
        <span></span>
      </div>
    );
  }
}

export default Track;
